To solve the problem of decoding a string where the encoded string is repeated a certain number of times, we can use a stack-based approach. Here's a C++ solution that addresses the given problem:

```cpp
class Solution {
public:
    string decodeString(string s) {
        string result = "";
        stack<char> st;

        for (int i = 0; i < s.length(); i++) {
            if (s[i] != ']') {
                st.push(s[i]);
            } else {
                string temp = "";
                while (st.top() != '[') {
                    temp = st.top() + temp;
                    st.pop();
                }
                st.pop(); // Pop the '[' character

                string num = "";
                while (!st.empty() && isdigit(st.top())) {
                    num = st.top() + num;
                    st.pop();
                }

                int k = stoi(num);
                for (int j = 0; j < k; j++) {
                    for (int t = 0; t < temp.length(); t++) {
                        st.push(temp[t]);
                    }
                }
            }
        }

        while (!st.empty()) {
            result = st.top() + result;
            st.pop();
        }

        return result;
    }
};
```

### Explanation:
1. **Stack Initialization**: We use a stack to keep track of characters and numbers.
2. **Iterate Through the String**: 
   - If the current character is not `]`, push it onto the stack.
   - If the current character is `]`, it means we have a closing bracket, so we need to:
     - Pop characters from the stack until we find `[` (store them in a temporary string `temp`).
     - Pop the `[` character from the stack.
     - Pop the number of repetitions from the stack (if any).
     - Repeat the substring `temp` for the number of repetitions and push the characters back onto the stack.
3. **Final Result**: After processing all characters, the stack will contain the decoded string in reverse order. We pop the characters from the stack and append them to the result string.

This solution handles the constraints and examples provided in the problem statement effectively.

