    .owner = THIS_MODULE,
    .name = "mtk_nand",
    .writesize = 4096,
    .erasesize = 128 << 10,
    .writebufsize = 4096,
    .read_oob_ecc = NAND_READ_ECC_NONE,
    .ecc_size = 0,
    .read_oob_size = 16,
