};

static int __init mtk_nand_init(void)
{
    struct mtk_nand_chip *nand;
    struct nand_chip *chip;
    struct mtd_info *mtd;
    int ret;

    nand = kzalloc(sizeof(*nand), GFP_KERNEL);
    if (!nand)
        return -ENOMEM;

    chip = &nand->nand;
    mtd = &nand_mtd_info;

    // 初始化NAND控制器
    nand->nand.mtd = mtd;
    nand->nand.width = 1;
    nand->nand.select_chip = nand_select_chip;
    nand->nand.nor_controller = nand_nor_controller;
    nand->nand.write_oob = nand_write_oob;

    // 设置UUID缓冲区
    nand->uuid = kzalloc(16, GFP_KERNEL);
    if (!nand->uuid) {
        ret = -ENOMEM;
        goto err_free_nand;
    }
    nand->uuid_size = 16;

    // 初始化NAND控制器
    ret = nand_nor_init(chip, nand->nand.mtd, nand->nand.width);
    if (ret)
        goto err_free_uuid;

    // 初始化MTK NAND驱动
    ret = mtd_register(&nand_mtd_info);
    if (ret)
        goto err_free_uuid;

    return 0;

err_free_uuid:
    kfree(nand->uuid);
err_free_nand:
    kfree(nand);
    return ret;
}

static void __exit mtk_nand_exit(void)
{
    struct mtk_nand_chip *nand = kzalloc(sizeof(*nand), GFP_KERNEL);
    if (!nand)
        return;

    // 卸载NAND驱动
    mtd_unregister(&nand_mtd_info);
    kfree(nand->uuid);
    kfree(nand);
}

